import { Carousel } from "antd";
import "antd/es/carousel/style/css";
import React from "react";

class MyCarousel extends React.Component {
  render() {
    return (
      <div>
        <Carousel autoplay>
          <div>
            <h3>
              <img src="https://images.pexels.com/photos/1054289/pexels-photo-1054289.jpeg?auto=compress&cs=tinysrgb&dpr=3&h=750&w=1260" />
            </h3>
          </div>
          <div>
            <h3>2</h3>
          </div>
          <div>
            <h3>3</h3>
          </div>
          <div>
            <h3>4</h3>
          </div>
        </Carousel>
      </div>
    );
  }
}

export default MyCarousel;
